def get_common_chances(common_map, X_chances, O_chances):
    Xw, Ow, N = 0, 0, 0
    for i in range(1000):
        C_M = copy.deepcopy(common_map)
        while is_leaf(C_M) is False:
            g = []
            for i in range(3):
                for j in range(3):
                    if C_M[i, j] == -1:
                        g.append([i, j])
            Row, Col = g[round(random.uniform(0, len(g)-1))]
            win = round(random.uniform(0, 100000))
            if win < X_chances[Row, Col]*100000:
                C_M[Row, Col] = 1
            elif win < (X_chances[Row, Col] + O_chances[Row, Col])*100000:
                C_M[Row, Col] = 0
            else:
                C_M[Row, Col] = 2
        if winner(C_M) == -1:
            N += 1
        if winner(C_M) == 1:
            Xw += 1
        if winner(C_M) == 0:
            Ow += 1
    return Xw / 1000, Ow / 1000, N / 1000


def get_index(map_):
    k = 0
    num = 0
    for i in range(3):
        for j in range(3):
            num += (map_[j, i]+1)*(3**k)
            k += 1
    return num


def winner(map_):
    for i in range(0, 3):
        if map_[i, 0] == map_[i, 1] == map_[i, 2] != -1 != 2:
            return map_[i, 0]
        if map_[0, i] == map_[1, i] == map_[2, i] != -1 != 2:
            return map_[0, i]
    if map_[0, 0] == map_[1, 1] == map_[2, 2] != -1 != 2:
        return map_[0, 0]
    if map_[2, 0] == map_[1, 1] == map_[0, 2] != -1 != 2:
        return map_[i, 0]
    return -1


def is_leaf(map_):
    if winner(map_) != -1:
        return True
    for i in range(3):
        for j in range(3):
            if map_[i, j] == -1:
                return False
    return True


